const findTheDifference = (s, t) => {
  const stringToArray = (s) => {
    let newString = [];
    for (let i = 0; i < s.length; i++) {
      newString.push(s[i]);
    }
    return newString.sort();
  };
  const newS = stringToArray(s);
  const newT = stringToArray(t);
  for (let i = 0; i < newT.length; i++) {
    if (newS[i] !== newT[i]) return newT[i];
  }
};

//3 O(n) = O(n)?

console.log(
  findTheDifference(
    "",
    ""
  )
);

